import {CREATE_ROOM} from "../actions";

const initialState = {
    room: 0
}

const testReducer = (state = initialState, action) => {
    switch (action.type) {
        case CREATE_ROOM:
            console.log(state.room)
            return [...state, {room: 2}];

        default:
            return state;
    }
}

export default testReducer;
